sys_variable_value.value:
(function execute(inputs, outputs) {

  var naics = JSON.parse(inputs['naics']);

  var bodyReq = {
    "filters": {
      "time_period": [
        {
          "start_date": inputs['startDate'].toString(),
          "end_date": inputs['endDate'].toString()
        }
      ],
      "award_type_codes": [
        "A",
        "B",
        "C",
        "D"
      ],
      "agencies": [getAgencie(inputs['fundingAgencie'], 'funding'), getAgencie(inputs['fundingAgencie'], 'awarding')],
      "naics_codes": naics
    },
    "fields": [
      "Award ID",
      "Award Amount",
      "Award Type",
      "Awarding Agency Code",
      "Awarding Agency",
      "awarding_agency_id",
      "Awarding Sub Agency Code",
      "Awarding Sub Agency",
      "Base Obligation Date",
      "CFDA Number",
      "Contract Award Type",
      "Description",
      "End Date",
      "Funding Agency Code",
      "Funding Agency",
      "Funding Sub Agency Code",
      "Funding Sub Agency",
      "generated_internal_id",
      "Issued Date",
      "Last Date to Order",
      "Last Modified Date",
      "Loan Value",
      "Period of Performance Current End Date",
      "Period of Performance Start Date",
      "Place of Performance City Code",
      "Place of Performance Country Code",
      "Place of Performance State Code",
      "Place of Performance Zip5",
      "Prime Award ID",
      "Prime Recipient Name",
      "prime_award_recipient_id",
      "prime_award_internal_id",
      "prime_award_generated_internal_id",
      "Recipient DUNS Number",
      "Recipient Name",
      "recipient_id",
      "SAI Number",
      "Start Date",
      "Sub-Award Amount",
      "Sub-Award Date",
      "Sub-Award ID",
      "Sub-Award Type",
      "Sub-Awardee Name",
      "Subsidy Cost"
    ],
    "page": inputs['page'],
    "limit": 100,
    "sort": "Award Amount",
    "order": "desc",
    "subawards": false
  };

  gs.info('Calling USA Spending by awards ID API -> {0}',JSON.stringify(bodyReq));
  outputs['req_body'] = JSON.stringify(bodyReq);

  function getAgencie(name, type) {
  	if(name == 'U.S. Census Bureau') {
    	return {tier: "subtier", name: "U.S. Census Bureau", toptier_name: "Department of Commerce", type: type };
    } else if(name == 'Internal Revenue Service') {
    	return {tier: "subtier", name: "U.S. Census Bureau", toptier_name: "Department of the Treasury", type: type};
    } else {
    	return {tier: "subtier", name: "Food and Drug Administration", toptier_name: "Department of Health and Human Services", type: type};
    }
  }
})(inputs, outputs);

