sys_variable_value.value:
(function execute(inputs, outputs) {
  var results = [];
  if(inputs['status']==200) {
    var awards = JSON.parse(inputs['responseBody']).results;
   	results = awards.map(getFields);
  }

  outputs['award_ids'] = results;

  function getFields(item, index) {
    var award = {};
    award.award_id = item['Award ID'];
    award.generated_unique_award_id = item['generated_internal_id'];
    return award;
  }
})(inputs, outputs);

